        await axios.get(`http://localhost:5000/video/${props.videoData.video_id}`)
        .then(response => {
            setVideoDetail(response.data)
        })
        .catch(error => {
            console.error(error);
        });
      };
  return (
    <div>
        { videoDetail &&
            <div className='grid grid-cols-2'>
                <div>

                </div>
